import React from 'react';
import bgvid from '../public/files/bgvid.mp4';

function Home() {
  return (
    <div className="banner">
      <video src={bgvid} autoPlay muted loop />
      <div className="content">
        <h1>Travel-Tribe</h1>
        <p>Plan your trip with us!</p>
      </div>
    </div>
  );
}

export default Home;
